import GameSection from "./GameSection";


function App() {

    const [randFour, setRandFour] = useState("");
    useEffect(() => {
      fetch("http://localhost:8000/message")
        .then((res) => res.json())
        .then((data) => setRandFour(data.randFour));
    }, []);
    console.log(randFour);
    return (

        <div>
            <h1>This is 24</h1>
            <GameSection randNum = {randFour}/>
            <h1>{randFour}</h1>
        </div>
    );
}

export default App;
